import React from 'react';
import { Link } from 'react-router-dom';
import Header from '../../components/layout/Header';
import Footer from '../../components/layout/Footer';

const Applications = () => {
  // Mock data
  const applications = [
    {
      id: 1,
      jobTitle: 'Senior Frontend Developer',
      company: 'Nomad',
      status: 'Applied',
      date: '2024-04-01',
      location: 'Remote',
      salary: '$80k - $120k',
      type: 'Full-time'
    },
    {
      id: 2,
      jobTitle: 'Full Stack Developer',
      company: 'Discord',
      status: 'Interview',
      date: '2024-03-28',
      location: 'San Francisco, CA',
      salary: '$90k - $130k',
      type: 'Full-time'
    },
    {
      id: 3,
      jobTitle: 'Backend Developer',
      company: 'GitHub',
      status: 'Rejected',
      date: '2024-03-15',
      location: 'Remote',
      salary: '$85k - $115k',
      type: 'Full-time'
    }
  ];

  const getStatusColor = (status: string) => {
    switch (status.toLowerCase()) {
      case 'applied':
        return 'bg-blue-100 text-blue-800';
      case 'interview':
        return 'bg-yellow-100 text-yellow-800';
      case 'rejected':
        return 'bg-red-100 text-red-800';
      case 'accepted':
        return 'bg-green-100 text-green-800';
      default:
        return 'bg-gray-100 text-gray-800';
    }
  };

  return (
    <>
      <Header />
      <div className="min-h-screen bg-gray-50 py-8">
        <div className="container mx-auto px-4">
          <div className="flex justify-between items-center mb-8">
            <h1 className="text-3xl font-bold text-gray-900">My Applications</h1>
            <div className="flex gap-4">
              <button className="px-4 py-2 bg-white text-gray-700 rounded-lg border border-gray-300 hover:bg-gray-50">
                Sort by Date
              </button>
              <button className="px-4 py-2 bg-white text-gray-700 rounded-lg border border-gray-300 hover:bg-gray-50">
                Filter by Status
              </button>
            </div>
          </div>

          <div className="space-y-4">
            {applications.map((application) => (
              <div key={application.id} className="bg-white rounded-lg shadow p-6">
                <div className="flex justify-between items-start">
                  <div>
                    <h2 className="text-xl font-semibold text-gray-900">{application.jobTitle}</h2>
                    <p className="text-gray-600">{application.company}</p>
                  </div>
                  <span className={`px-3 py-1 rounded-full text-sm font-medium ${getStatusColor(application.status)}`}>
                    {application.status}
                  </span>
                </div>

                <div className="mt-4 flex flex-wrap gap-4 text-sm text-gray-600">
                  <span>{application.location}</span>
                  <span>•</span>
                  <span>{application.salary}</span>
                  <span>•</span>
                  <span>{application.type}</span>
                  <span>•</span>
                  <span>Applied on {application.date}</span>
                </div>

                <div className="mt-6 flex gap-4">
                  <Link 
                    to={`/jobs/${application.id}`}
                    className="px-4 py-2 bg-emerald-600 text-white rounded-lg hover:bg-emerald-700"
                  >
                    View Job
                  </Link>
                  <button className="px-4 py-2 bg-white text-emerald-600 rounded-lg border border-emerald-600 hover:bg-emerald-50">
                    View Application
                  </button>
                  <button className="px-4 py-2 bg-white text-red-600 rounded-lg border border-red-600 hover:bg-red-50">
                    Withdraw Application
                  </button>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
      <Footer />
    </>
  );
};

export default Applications;
